  return (
    <div>
      <Navbar />
      <div className="mt-4 mb-3">
        <BookUs />
      </div>
      <div className="container" style={{ maxHeight: "40rem" }}>
        <CarouseLComponent />
      </div>
    </div>
  );
}

export default Booking;
